import {
  USERS_TOTAL,
  USERS_LAST_YEAR,
  GROUP_TOTAL
} from "../actions/ActionTypes";

export default function(state = {}, action) {
  switch (action.type) {
    case USERS_TOTAL:
      return Object.assign({}, state, {
        userStats: action.payload
      });
    case USERS_LAST_YEAR:
      return Object.assign({}, state, {
        usersLastYear: action.payload
      });
    case GROUP_TOTAL:
      return Object.assign({}, state, {
        groupTotal: action.payload
      });
    default:
      return state;
  }
}
